import Content from "./Content";
import dummy from "./../db/contents.json";

const BookmarkList = (props) => {
  return (
    <div>
      <h1>북마크 모아보기</h1>
      <div>
        {dummy.contents
          .filter((contents) => {
            return props.trueIDArr.includes(String(contents.id));
          })
          .map((trueContent) => (
            <Content
              key={trueContent.id}
              id={trueContent.id}
              title={trueContent.title}
              content={trueContent.content}
              trueIDArr={props.trueIDArr}
              onBookmarkTrue={props.onBookmarkTrue}
              onBookmarkTrue={props.onBookmarkTrue}
            ></Content>
          ))}
      </div>
    </div>
  );
};

export default BookmarkList;
